import React from 'react';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import News from "./components/news.components";
import Form from "./components/form.component";

function App() {
  return (
    <div className="App">
      <h1>Apis</h1>
      <Form />
      <News /> 
    </div>
  );
}

export default App;
